package site.bluemoon.dto;

public class AdminOceanNews {
	private int newsNo;
	private String newsDate;
	private String newsCont;
	private int newsUno;
	private int userNo;
	private String userId;
	private String userName;
	
	public AdminOceanNews() {
		// TODO Auto-generated constructor stub
	}

	public int getNewsNo() {
		return newsNo;
	}

	public void setNewsNo(int newsNo) {
		this.newsNo = newsNo;
	}

	public String getNewsDate() {
		return newsDate;
	}

	public void setNewsDate(String newsDate) {
		this.newsDate = newsDate;
	}

	public String getNewsCont() {
		return newsCont;
	}

	public void setNewsCont(String newsCont) {
		this.newsCont = newsCont;
	}

	public int getNewsUno() {
		return newsUno;
	}

	public void setNewsUno(int newsUno) {
		this.newsUno = newsUno;
	}

	public int getUserNo() {
		return userNo;
	}

	public void setUserNo(int userNo) {
		this.userNo = userNo;
	}

	public String getUserId() {
		return userId;
	}

	public void setUserId(String userId) {
		this.userId = userId;
	}

	public String getUserName() {
		return userName;
	}

	public void setUserName(String userName) {
		this.userName = userName;
	}
}
